import { BrowserRouter, Route, Routes } from "react-router-dom";
import HomePageOne from "./pages/HomePageOne";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path='/' element={<HomePageOne />} />
        <Route exact path='/account' element={<AccountPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
